import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import './App.css';
import LogIn from './components/LogIn';
import SignUp from './components/signUp/SignUp';
function App() {
  return (
    <div className="App">
      <div className='bg-img'>
        <LogIn />
        <SignUp />
      </div>
    </div>
  );
}

export default App;
